import React from 'react'
import {
    Link
} from "react-router-dom";

export const Button = ({size="regular", to="/", value=""}) => {
    size = "btn-" + size
    return (
        <Link class={size} to={to} ><button style={size}>{value}</button></Link>
    )
}

export default Button
